const Index = ({ photos }) => {
  return (
    <div>
      <Navbar />
      <h1>Our Index Page</h1>
      <ul>
        {photos.map((photo) => (
          <li>{photo.id}</li>
        ))}
      </ul>
    </div>
  );
};
Index.getInitialProps = async (ctx) => {
  const res = await axios.get(
    "https://api.unsplash.com/photos/?client_id=oPeX2b24aAVWiEmjKq0I2RRr6XbF_KpwUutWmFufaGU"
  );
  const { data } = res;
  return { photos: data };
};
export default Index;
